import Link from 'next/link';

const Nav = () => (
  <ul className="nav">
    <li>
      <Link href="/">
        <span>

        <object className="icon" type="image/svg+xml" data="static/home.svg">
          Your browser does not support SVG
        </object>
        <a>Home</a>
        </span>
      </Link>
    </li>
    <li>
      <Link href="/projects">
        <a>Projects</a>
      </Link>
    </li>
    <li>
      <Link href="/about">
        <a>About Me</a>
      </Link>
    </li>
    <style jsx>{`
      .nav {
        font-family: 'Varta';
        margin: 0px 0 0;
        list-style: none;
        display: flex;
        background: #232A34;
      }
      .icon {
        height: 40px;
      }
      .icon:hover {
        fill: #f2ab37;
      }
      .nav li a {
        display: inline-block;
        height: auto;
        font-size: 16px;
        color: #505765;
        font-weight: 300;
        min-height: 65px;
        padding: 20px 40px;
        text-align: center;
        -o-transition:.5s;
        -ms-transition:.5s;
        -moz-transition:.5s;
        -webkit-transition:.5s;
        transition:.2s;
      }
      .nav li a:hover {
        padding-bottom: 3px;
        color: #f2ab37;
        border-bottom: 2px solid #f2ab37;
      }
      @media (max-width: 600px) {
        .nav {
          display: block;
          margin-top: 20px;
        }
        .nav li {
          display: inline-block;
        }
        .nav li a {
          font-size: 18px;
        }
      }
    `}</style>
  </ul>
);

export default Nav;
